/* Form to create an user. */

import { lg_api } from "../../__modules__";
import "../../css/users/CreateUser.css";
import React from "react";

class CreateUser extends React.Component {
  constructor() {
    super();
    this.state = { new_user: [] };

    // Methods
    this.handleInput = this.handleInput.bind(this);
    this.submitUser = this.submitUser.bind(this);
  }

  // Handle all inputs.
  handleInput(e) {
    this.setState({ profile_data: e.target.value });
  }

  // Create a new user.
  async submitUser(e) {
    let form_user = new FormData();

    // Data
    let username = document.querySelector("#id_username").value;
    let email = document.querySelector("#id_email").value;
    let first_name = document.querySelector("#id_first_name").value;
    let last_name = document.querySelector("#id_last_name").value;
    let biography = document.querySelector("#id_biography").value;
    let picture = document.querySelector('input[type="file"]').files[0];

    // Username validation
    if (username !== undefined) {
      form_user.append("username", username);
    }

    // Email validation
    if (email !== undefined) {
      form_user.append("email", email);
    }

    // First name validation
    if (first_name !== undefined) {
      form_user.append("first_name", first_name);
    }

    // Last name validation
    if (last_name !== undefined) {
      form_user.append("last_name", last_name);
    }

    // Biography validation
    if (biography !== undefined) {
      form_user.append("biography", biography);
    }

    // Picture validation
    if (picture !== undefined) {
      form_user.append("picture", picture);
    }

    await lg_api("accounts/users/", {
      method: "post",
      headers: {
        "Content-Type": "multipart/form-data",
      },
      data: form_user,
    });
  }

  render() {
    return (
      <form method="post" encType="multipart/form-data">
        <div className="mx-auto mt-4 w-50">
          <h2 className="h2">Additional information to profile</h2>
          <div className="form-control">
            {/* Username */}
            <label htmlFor="id_username" className="form-label">
              Username:
            </label>
            <input
              type="text"
              placeholder="Username"
              id="id_username"
              className="form-control"
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Email */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_email" className="form-label">
              Email:
            </label>
            <input
              type="text"
              className="form-control"
              pattern=".+@gmail\.com"
              maxLength="170"
              minLength="8"
              id="id_email"
              placeholder="youremail@domain.com"
              aria-label="Your email"
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* First name */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_first_name" className="form-label">
              First name:
            </label>
            <input
              type="text"
              placeholder="First name"
              id="id_first_name"
              className="form-control"
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Last name */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_last_name" className="form-label">
              Last name:
            </label>
            <input
              type="text"
              placeholder="Last name"
              id="id_last_name"
              className="form-control"
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Biography */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_biography" className="form-label">
              Biography:
            </label>
            <input
              type="text"
              placeholder="Your biography"
              id="id_biography"
              className="form-control"
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Picture */}
          <div className="mb-2 col-sm-8 mx-auto">
            <label htmlFor="id_picture" className="form-label">
              Picture:
            </label>
            <input
              type="file"
              id="id_picture"
              accept="image/png, image/jpeg"
              className="form-control"
              onChange={(e) => {
                this.handleInput(e);
              }}
            />
          </div>

          {/* Submit */}
          <div class="d-grid gap-2 col-sm-8 mx-auto mb-2">
            <button type="submit" class="btn btn-primary">
              Register now!
            </button>
          </div>
        </div>
      </form>
    );
  }
}

export { CreateUser };
